import React, {Component} from 'react';
import {Button, Header, Container, Image} from 'semantic-ui-react';
import patientAvatar from '../images/avatar.png';

class Nav extends Component{
    render(){
        return(
            <div>

                <Container inline>
                    <Image src={patientAvatar}/>
                    <Header></Header>
                    <Header size="medium">Name: Patient's Name</Header>
                   <p>April 18, 1995 | Male</p>
                   <p>3rd St., 3rd Blk., Auread Subd., City of San Fernando</p>

					<Button color="blue">View Information</Button>
                	<Button color="blue">Edit Information</Button>


                </Container>


            </div>
        );
    }
}

export default Nav;
